import React from 'react';
import Title from "../Title";
import CustomInput from '../Input';
import {Container} from "@material-ui/core";


const Registration = () =>{
    return (
        <Container>
            <Title title={'Регистрация'}/>
            <CustomInput
              placeholder={'Email'}
              type={'text'}
            />
            <CustomInput
              placeholder={'password'}
              type={'password'}
            />
        </Container>
    )
}

export default Registration;
